import React from 'react';
import { useSelector, useDispatch } from 'react-redux';
import { ui_nav } from '../../../actions';

import { FiCamera, FiSearch, FiHeart, FiX } from 'react-icons/fi';

import './index.css';

function Footer() {
	const ui = useSelector(state => state.ui);
	const dispatch = useDispatch();

	return (
		<div className='footer'>
			<div className='container footer-container'>
			{ ui.nav === 2 ? <FiX className='footer-icon' onClick={() => dispatch(ui_nav(0))} /> : <FiSearch className='footer-icon' onClick={() => dispatch(ui_nav(2))} /> }
				<FiCamera className='footer-icon' />
				<FiHeart className='footer-icon' />
			</div>
		</div>
	);
}

export default Footer;
